#include "LIBUTI_SIF_getters.h"
#include "LIBUTI_SIF_getters_from_headers.h"

 TE_LIBUTI_SIF_status LIBUTI_SIF_get_header( const uint8_t * DecodedHeaderAddress, ts_LIBUTI_SIF_header * out ) {    TE_LIBUTI_SIF_status ret;    ts_LIBUTI_SIF_header_iterator hiter;    ret = E_LIBUTI_SIF_FAILURE;    if ( DecodedHeaderAddress != (uint8_t *)0 )    {       hiter.header = DecodedHeaderAddress;       hiter.header_length = (uint32_t)64;       hiter.position = (uint32_t)0;       out->header_length          = LIBUTI_SIF_get_long(&hiter);       out->format_version         = LIBUTI_SIF_get_short(&hiter);       out->format_revision        = LIBUTI_SIF_get_short(&hiter);       out->software_chars_abs_ptr = LIBUTI_SIF_get_long(&hiter);       out->targets_chars_abs_ptr  = LIBUTI_SIF_get_long(&hiter);       out->tool_chars_abs_ptr     = LIBUTI_SIF_get_long(&hiter);       out->requester_info_abs_ptr = LIBUTI_SIF_get_long(&hiter);       out->files_chars_abs_ptr    = LIBUTI_SIF_get_long(&hiter);       if ( ( out->header_length >= K_MIN_HEADER_LENGTH )         && ( out->software_chars_abs_ptr < out->header_length )         && ( out->targets_chars_abs_ptr < out->header_length ) )       {          if ( ( out->tool_chars_abs_ptr < out->header_length )            && ( out->requester_info_abs_ptr < out->header_length )            && ( out->files_chars_abs_ptr < out->header_length ) )          {             ret = E_LIBUTI_SIF_SUCCESS;          }       }    }    return ( ret ); }
